import React from 'react';
import { View,Text, TextInput, Button,StyleSheet,Image } from 'react-native';
import {BrowserRouter as Router, Link, Switch, Route} from "react-router-dom";
import Navigation from "./Navigation";

function Home(props) {
    return (
      <View >
         <Text><h3>Welcome to .....</h3></Text>
         <View>
             
             <h1>Kelly Chibuye Logistics</h1></View>
            <Image style={styles.Img} source={require('../../assets/images/logo.jpg') }  />
            <br/>
            <View>
                <Text><h3>Book a An Appointment with Us.....</h3></Text>
                <br/>
                <Image style={styles.Img} source={require('../../assets/images/Truck1.jpeg') }  />

            </View>
        


      </View>
    );
  }

export default Home;

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: '',
      justifyContent: '',
    },
    Img:{
        height:'160px',
        width:'100%',
       
    },
    imput:{
        border:" solid black",
        borderRadius:"15px",
        height:"35px"

    },
    text:{
       
        marginLeft:"35%"
     }
  });
